import React, { Component } from 'react';
import axios from 'axios';


export default class Devis extends Component {
    constructor(props) {
        super(props);
        this.state = {
            client: [],
            client_2: [],
        }
    }

    componentDidMount() {

        axios.get(`https://sayse.pipedrive.com/v1/deals?api_token=d168467b213a71acdc4ba5cb5b2cfe96529ac061&limit=500`)
            .then(res => {
                var data = [];

                res.data.data.forEach(element => {
                    data.push(element.person_name)
                });

                this.setState({ client: data })

            });
            axios.get(`https://sayse.pipedrive.com/v1/deals?api_token=d168467b213a71acdc4ba5cb5b2cfe96529ac061&start=500&limit=500`)
            .then(res => {
                var data = [];

                res.data.data.forEach(element => {
                    data.push(element.person_name)
                });

                this.setState({ client_2: data })

            });
    }

    render() {
        // console.log(this.state.client)

        return (
            <div className="container-fluid">
                <ul>
                    {
                        this.state.client.map(function (item, i) {
                            // console.log(item);
                            if (item !== null) {
                                return <li key={i}>{item}</li>;
                            } else {
                                console.log(null)
                            }
                        })
                    }
                    {
                        this.state.client_2.map(function (item, i) {
                            // console.log(item);
                            if (item !== null) {
                                return <li key={i}>{item}</li>;
                            } else {
                                console.log(null)
                            }
                        })
                    }
                </ul>
            </div>
        )
    }
}
